function Home(){

    return(
        <div>
            <div id='base-banner'>
                <img src={banner} id='banner' alt='banner'/>
                <button id="button"><a href="./Login/Login">Faça login</a></button>
            </div>
            <div className='base1'>
                <img src={office} id='office' />
                <h1>O que é a EasyTolls?</h1>
            </div>
        </div>
    );

}

export default Home;
